import React from "react"
import Link from 'next/link'

const InserirFuncionario = () => {
        return(
        <Link href='DadosFuncionarios'></Link>
    )
}

export default class ExibirInsercao extends React.Component{
    render(){
        return(
            <div>
                <a style={{fontSize:"30px", fontWeight:"bold"}} >INSERÇÃO DE DADOS</a>
                <p/>
                <button type="button" onClick={InserirFuncionario} style={{width:"250px", height:"28px"}}>
                    Inserir Novo Funcionário
                </button>
            </div>
        )
    }
}
